const CompAdd = () => {
  return (
    <form>
      <p>일정명 : <input required/></p>
      <p>날짜 : <input type="date" required/></p>
      <p>시간 : <input type="time" required/></p>
      <p>세부내용 : <textarea required></textarea></p>
      <button>일정추가하기</button>
    </form>
  );
};

export default CompAdd;
